import { Item } from '../../types/item';
import './List.css';

export const ListContainer = (props: Item) =>
    <div className="main-list-container">
        <ul>
            {props.items.map((todo) => (
                <li key={todo.id} onClick={() => handleToggle(todo)}>{todo.text}</li>
            ))}
        </ul>
        <input
            className="Input"
            type='text'
            placeholder='Add todo item'></input>
    </div>;
